//
// IMPORTS
//

import React from 'react'
import AppBar from 'material-ui/AppBar';

//
// COMPONENT
//

let Header = () => {
    return (
		<AppBar
      title='Meteor react-redux boilerplate'
      iconClassNameRight='muidocs-icon-navigation-expand-more'
	    />
	)
}

//
// EXPORT
//

export default Header
